import {Injectable, OnDestroy, OnInit} from '@angular/core';
import {BehaviorSubject, Observable} from "rxjs";
import {IPump} from "../models/IPump";
import {v4 as uuidv4} from "uuid";
import {HttpClient} from "@angular/common/http";
import {IOperationResult} from "../models/OperationResult";
import {error} from "@angular/compiler-cli/src/transformers/util";

@Injectable({
  providedIn: 'root'
})
export class WebService {

  private pumpsSubject: BehaviorSubject<IPump[]> = new BehaviorSubject<
    IPump[]
  >([]);
  public pumps$ = this.pumpsSubject.asObservable();
  private baseUrl = 'http://localhost:5068/api/Pump';
  public updatePumps(pumps: IPump[]): void {
    this.pumpsSubject.next(pumps);
  }
  constructor(private http: HttpClient) {
  }

  public UpdateConcretePump(id: string,pump : FormData){
    this.http.put<IOperationResult>(
      this.baseUrl + `/${id}`, pump,
      {
        responseType: 'json',
      }
    ).subscribe({
      next: res => {
        console.log(res.message);
      },
      error: e => {
        console.log(e);
      }
    })
  }
  public loadPumpsFromApi(): void {
    this.http.get<IPump[]>(
      this.baseUrl,
      {
        responseType: 'json',
      }
    ).subscribe({
      next: value => {
        this.updatePumps(value);
      },
      error: e => {
        console.log(e);
      }
    })
  }
  public generateRandomPump(): IPump {
    const str = '';
    return {
      id: `${Math.round(Math.random() * 100)}`,
      name: `Random Pump №${Math.round(Math.random() * 100)}`,
      maxpressure: Math.random() * 100,
      liquidtemperature: Math.random() * 100,
      weight: Math.random() * 1000,
      imagename: 'random-image.jpg',
      image: str,
      price: Math.random() * 1000,
      motorid: uuidv4(),
      framematerialid: uuidv4(),
      wheelmaterialid: uuidv4(),
      description: 'This is a random pump'
    };
  }
}
